        <ul className={`options-menu menu-${menuType}`}>
            {Object.entries(options).map(optionKvp => (
                <li className="options-menu-item" onClick={e => optionKvp[1](e)}>{optionKvp[0]}</li>
            ))}
        </ul>
    );
};

export default OptionsMenu;
